function Menu({ id, title, content }) {
  return (
    <Row
      style={{
        justifyContent: 'center',
        alignContent: 'center',
      }}
    >
      <Card
        key={id}
        title={title}
        hoverable={true}
        extra={<a href="#">More</a>}
        style={{ width: 500 }}
      >
        <p>{content}</p>
      </Card>
    </Row>
  );
}
export default Menu;
